import React from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import { useSelector, useDispatch } from "react-redux";
import { nextPage } from "../redux/actions/houseActions";

function HouseComponent() {
  const houses = useSelector((state) => state.allHouses.houses);
  const dispatch = useDispatch();
  const pageNumber = useSelector((state) => state.allHouses.pageNumber);

  const toNextPage = async () => {
    try {
      const response = await axios.get(
        `https://www.anapioficeandfire.com/api/houses/?page=${pageNumber + 1}`
      );
      response?.data && dispatch(nextPage(response.data));
    } catch {
      console.log("ërror");
    }
  };

  var i = 0;
  const renderList = houses.map((house) => {
    i++;
    const { name, region, coatOfArms, words } = house;
    return (
      <div key={name}>
        <Link to={`/houses/${i}`}>
          {/* <div className="ui link cards">
          <div className="card">
            <div className="content"> */}
          <ul>
            <li>{name}</li>
            <ul>
              <li>{region ? region : "No Information"}</li>
              <li>{coatOfArms ? coatOfArms : "No Information"}</li>
              <li>{words ? words : "No Information"}</li>
            </ul>
          </ul>
          {/* <div className="header">{name}</div>
              <div className="header">{region}</div>
              <div className="header">{coatOfArms}</div>
              <div className="header">{words}</div> */}
        </Link>
      </div>
      //     </div>
      //   </div>
      //   <h1>House Component</h1>
      // </div>
    );
  });

  return (
    <>
      {renderList}
      <button onClick={toNextPage}>Next</button>
    </>
  );
}

export default HouseComponent;
